impl Solution {
    pub fn incremovable_subarray_count(nums: Vec<i32>) -> i64 {
        let n = nums.len() as i64;
        let mut lis = vec![1; n as usize];
        let mut lds = vec![1; n as usize];

        for i in 1..n as usize {
            for j in 0..i {
                if nums[i] > nums[j] {
                    lis[i] = lis[i].max(lis[j] + 1);
                }
            }
        }

        for i in (0..n as usize).rev() {
            for j in (i + 1)..n as usize {
                if nums[i] > nums[j] {
                    lds[i] = lds[i].max(lds[j] + 1);
                }
            }
        }

        let mut result = 0;
        for i in 0..n as usize {
            result += ((lis[i] + lds[i] - 1) as i64).min(n);
        }

        result - n * (n + 1) / 2
    }
}
